import React, { useState, useEffect } from 'react'
import axios from 'axios'


const App = () => {

const [albums,setAlbums] = useState();

  const fetchTours =  () => {
    axios.get('https://hk-test-api.herokuapp.com/albums', {headers: {
      accept: 'application/json',
      'X-API-Key': 'secret'
  }})
    .then((response) => {
        console.log(response.data);
        setAlbums(response.data)
    })
    .catch(e => {
        console.log('Error: ', e.response.data)
    });
  }
  useEffect(() => {
    fetchTours()
  }, [])

  albums.map((test) => {
    console.log(test)
  })

  return (
  <div>
    <p>Moin Meister</p>
  </div>
  )
}

export default App
